var title_f42_41_43671="The role of collagen in the fibrous cap";
var content_f42_41_43671=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F65967&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F65967&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 624px\">",
"   <div class=\"ttl\">",
"    Collagen synthesis and breakdown in the maintenance of the integrity of the fibrous cap",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 604px; height: 338px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Illustration emphasizes the importance of collagen synthesis and breakdown in the maintenance of the integrity of the fibrous cap. Vascular smooth muscle cells synthesize essential extracellular matrix proteins such as collagen and elastin from amino acids. This process may be inhibited by interferon-&gamma; (IFN-&gamma;) secreted by activated T cells, thereby disrupting collagen synthesis, which may interfere with the maintenance and repair of collagen framework supporting the fibrous cap. Importantly, the expression of CD40 ligand on T cells may promote tissue proteolysis through the release and activation of matrix-degrading enzymes produced by vascular smooth muscle cells and inflammatory macrophages. Activated macrophages within the fibrous cap can secrete tissue proteases that facilitate the breakdown of collagen and elastin to peptides and amino acids. The loss of structural molecules provided by the extracellular matrix can thin and weaken the fibrous cap, rendering it particularly susceptible to rupture, which can manifest as acute coronary syndromes. Additional factors involved in the activation of macrophages include tumor necrosis factor-&alpha; (TNF-&alpha;), macrophage colony-stimulating factor (M-CSF), and macrophage chemoattractant protein-1 (MCP-1), among others.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Libby P. Molecular bases of the acute coronary syndromes. Circulation 1995; 91:2844, with modifications by Dr. Peter Libby. Copyright &copy; 1995 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
