var title_f42_41_43672="Hypospadias 2 stage repair 1";
var content_f42_41_43672=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76582%7EPEDS%2F55604&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76582%7EPEDS%2F55604&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    Stage one of two-stage hypospadias repair",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 660px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The first stage includes correction of penile curvature and transfer of dorsal foreskin to the ventral aspect of the penis. A) Scrotal hypospadias with penile curvature. B) Initial dissection removing ventral tethering urethral plate tissue. C) Penile straightening with dorsal plication. D) Confirmation of a straight penis with artificial saline erection. E) In select cases, part of urethral plate can be preserved. F) The dorsal skin is split and wrapped to the ventrum. G) First stage complete with temporary catheter in the urethral meatus at the penile scrotal junction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Figure modified from TTMed (Timely Topics in Medicine)-Urology USA. Copyright &copy; 2009 Prous Science S.A.U. or its licensors. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    Stage two of two-stage hypospadias repair",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 647px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Second-stage urethroplasty is done 6 months after the first-stage surgery. H) Preoperative view. I) Initial incision on the ventrum outlining the new urethra. J) Urethroplasty. K) Completed urethroplasty with second layer of supporting tissue to prevent fistula. L) Completed repair.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Figure modified from TTMed (Timely Topics in Medicine)-Urology USA. Copyright &copy; 2009 Prous Science S.A.U. or its licensors. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
