var title_f42_41_43676="Cross-allergenicity - Pollens - dust mites - cockroaches";
var content_f42_41_43676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F56544&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F56544&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Patterns of cross-allergenicity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Trees",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Birch, Alder, Hazelnut, Hornbeam",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        European olive, Ash, Privet, Russian olive",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cedar, Cypress, Juniper, Arbor Vitae",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Beech, Oak",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pecan, Hickory",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Poplar, Aspen, Cottonwood",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Grasses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Northern pasture grasses: timothy, orchard, Kentucky blue, red top, meadow fescue, perennial rye, and sweet vernal",
"       </td>",
"       <td>",
"        Usually timothy used to cover this group, but can use a mixture of several species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bermuda",
"       </td>",
"       <td>",
"        Allergenically distinct from Northern pasture grasses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bahia and Johnson",
"       </td>",
"       <td>",
"        Use additionally if locally important",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Weeds",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Short, giant, false, and western ragweed",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Southern and slender ragweed, cocklebur, burweed marsh elder",
"       </td>",
"       <td>",
"        Use additionally if locally important",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sages, wormwood, mugworts",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pigweed, Palmer's amaranth, Western water hemp",
"       </td>",
"       <td>",
"        Use locally most important species",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Russian thistle,",
"        <em>",
"         Kochia",
"        </em>",
"        , lambs quarters",
"       </td>",
"       <td>",
"        <p>",
"         Use locally most important species",
"        </p>",
"        <p>",
"         If Russian thistle and",
"         <em>",
"          Kochia",
"         </em>",
"         &nbsp;both prevalent, use mixture",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        House dust mites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Dermatophagoides pteronyssinus",
"        </em>",
"        and",
"        <em>",
"         Dermatophagoides farinae",
"        </em>",
"       </td>",
"       <td>",
"        Use mixture if both locally important",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Cockroach",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        German and American cockroach",
"       </td>",
"       <td>",
"        Use mixture",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
