var title_f42_41_43677="PEG rHuMGDF PBPC mobilization";
var content_f42_41_43677=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F61207&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F61207&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 530px\">",
"   <div class=\"ttl\">",
"    PEG-rHuMGDF enhances mobilization of PBPCs",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 510px; height: 316px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The fold increase in peripheral blood progenitor cells (PBPCs) from day 1 (baseline) to day 15 in patients treated with chemotherapy on day 1 followed by either granulocyte colony-stimulating factor (G-CSF) alone or in combination with PEG-rHuMGDF. PBPC mobilization was markedly enhanced by combination therapy with G-CSF and PEG-rHuMDGF.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Basser, RL, Rasko, JE, Clarke, K, et al, Blood 1997; 89:3118.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
